import React from 'react';

const TemplatesPage = () => {
  return (
    <div style={{ padding: '2rem' }}>
      <h1>Choose Your Menu Template</h1>
      <p>This feature is coming soon! Here you will be able to select from 8 different menu designs.</p>
    </div>
  );
};

export default TemplatesPage;
